import React, { useState } from "react";
import { FlatList, StyleSheet, View } from "react-native";

import AppText from "../components/AppText";
import Screen from "../components/Screen";
import colors from "../config/colors";

//const dyeChoices = choices.dyeChoices;


function Budgets({navi}) {
    return (
      <Screen style={styles.screen}>
        <AppText style={styles.title}>Ingredient Budgets!</AppText>
      <View style={[styles.container, {
        flexDirection: "row"
      }]}/>
      <View style={{ flex: 1}} />
        <Text style={styles.header1}>$25</Text>
        <Text style={styles.text1}>This is a test box for text!</Text>
      <View style={{ flex: 1}} />
      <View style={{ flex: 1}} />
      <View style={{ flex: 1}}/>
      
      </Screen>
    );
}

const styles = StyleSheet.create({
  screen: {
    flex: 1,
    backgroundColor: colors.light,
    justifyContent: "center",
    alignItems: "center",
  },
  container: {
    flex: 1,
    padding: 20,
  },
  title: {
    color: colors.eltrdarkblue,
    fontSize: 40,
    marginBottom: 20,
    marginTop: 200,
  },
  header1: {
    color: colors.eltrdarkblue,
    fontSize: 25,
    marginBottom: 20,
    marginTop: 100,
  },
  text1: {
    color: colors.eltrdarkblue,
    fontSize: 10,
  },
  
});

export default Budgets;
